	private CustomHead head = null;
	public final String name, player, texture;
	
	MHFHead(String name, String player, String texture){
		this.name = name;
		this.player = player;
		this.texture = texture;
	}
	
	public CustomHead getHead() {
		if(head == null){
			head = new CustomHead("mhf:" + player, name, texture, Head.Category.MHF, "Official", "MHF");
		}
		return head;
	}
	
